const appid = '70320A381C7D473A8059EC14A1CEEF20';
const vn = 'es-3.1.6';
const vc = '';
const TDBaseUrl = 'https://jic.talkingdata.com/app/h5/v1/websdk';
const TDRequestUrl = 'https://h5.udrig.com/app/v1';
window["TDAPP"] = {};
window["TDAPP"].onEvent = function (id, label, params) {
    if (arguments.length > 0) {
        try {
            const opts = {count: 1, start: new Date().getTime()};
            if (id != undefined) {
                opts["id"] = typeof id != "string" ? JSON.stringify(id) : id
            }
            if (label != undefined) {
                opts["label"] = typeof label != "string" ? JSON.stringify(label) : label
            } else {
                opts["label"] = ""
            }
            if (params != undefined) {
                const isJson = function (obj) {
                    const isjson = typeof (obj) == "object" && Object.prototype.toString.call(obj).toLowerCase() == "[object object]" && !obj.length;
                    return isjson
                };
                if (isJson(params)) {
                    opts["params"] = params
                } else {
                    opts["params"] = {params: ""}
                }
            }
            const eventName = "__TD_td-init-event";
            const ev = localStorage[eventName];
            if (ev) {
                const ca = JSON.parse(ev);
                ca.push(opts);
                localStorage.setItem(eventName, JSON.stringify(ca));
                return
            }
            ;localStorage.setItem(eventName, "[" + JSON.stringify(opts) + "]")
        } catch (e) {
        }
    }
};
